Ólafur Ragnar Grímsson (f. 14. maí 1943) var fimmti forseti Íslands, fyrrum ráðherra og þingmaður. Ólafur er doktor í stjórnmálafræði, hann var prófessor við Háskóla Íslands og sat á þingi fyrir Samtök frjálslyndra og vinstri manna og Alþýðubandalagið. Áður var hann í Framsóknarflokknum og var þar kenndur við Möðruvallahreyfinguna.

